import styled from 'styled-components';
import { motion } from 'framer-motion';
import { BaseSection, GlowBackground } from '../components/shared/BackgroundEffects';

const DeDaSSection = styled(BaseSection)`
  padding: 6rem 2rem;
  color: white;
  position: relative;
`;

const Container = styled.div`
  max-width: 1400px;
  margin: 0 auto;
  position: relative;
`;

const Header = styled.div`
  text-align: center;
  margin-bottom: 4rem;
`;

const Title = styled.h1`
  font-size: 3rem;
  color: white;
  margin-bottom: 1.5rem;
`;

const Subtitle = styled.h2`
  font-size: 1.5rem;
  color: rgba(255, 255, 255, 0.9);
  margin-bottom: 2rem;
`;

const StatsGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(5, 1fr);
  gap: 1.5rem;
  margin-bottom: 2rem;
`;

const StatCard = styled.div`
  background: white;
  border-radius: 12px;
  padding: 1.5rem;
  box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
`;

const StatTitle = styled.div`
  color: ${({ theme }) => theme.colors.darkPurple};
  font-size: 0.9rem;
  margin-bottom: 0.5rem;
`;

const StatValue = styled.div`
  color: ${({ theme }) => theme.colors.darkPurple};
  font-size: 1.5rem;
  font-weight: bold;
  margin-bottom: 0.5rem;
`;

const StatChange = styled.div`
  color: ${({ isPositive }) => (isPositive ? '#4CAF50' : '#F44336')};
  font-size: 0.9rem;
  display: flex;
  align-items: center;
  gap: 0.25rem;

  &::before {
    content: '${({ isPositive }) => (isPositive ? '▲' : '▼')}';
  }
`;

const MonitoringSection = styled.div`
  display: grid;
  grid-template-columns: 1fr 1fr;
  gap: 1.5rem;
  margin-bottom: 2rem;
`;

const Card = styled.div`
  background: white;
  border-radius: 12px;
  padding: 1.5rem;
  box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
`;

const CardTitle = styled.h3`
  color: ${({ theme }) => theme.colors.darkPurple};
  font-size: 1.25rem;
  margin-bottom: 1rem;
`;

const DeDaS = () => {
  return (
    <DeDaSSection>
      <GlowBackground />
      <Container>
        <Header>
          <Title>DeDaS</Title>
          <Subtitle>Decentralized Data Storage</Subtitle>
        </Header>
        <StatsGrid>
          <StatCard>
            <StatTitle>Total Revenue</StatTitle>
            <StatValue>$ 24543.86</StatValue>
            <StatChange isPositive>$ 2531.86</StatChange>
          </StatCard>
          <StatCard>
            <StatTitle>Total Users</StatTitle>
            <StatValue>3070.00</StatValue>
            <StatChange isPositive>377.00</StatChange>
          </StatCard>
          <StatCard>
            <StatTitle>Total Storage</StatTitle>
            <StatValue>605.73 Tb</StatValue>
            <StatChange isPositive={false}>46.62 Tb</StatChange>
          </StatCard>
          <StatCard>
            <StatTitle>Available Storage</StatTitle>
            <StatValue>194.00 Tb</StatValue>
            <StatChange isPositive={false}>29.00 Tb</StatChange>
          </StatCard>
          <StatCard>
            <StatTitle>Bugs Reported</StatTitle>
            <StatValue>2.00</StatValue>
            <StatChange isPositive>2.00</StatChange>
          </StatCard>
        </StatsGrid>

        <MonitoringSection>
          <Card>
            <CardTitle>Storage Monitoring</CardTitle>
          </Card>

          <Card>
            <CardTitle>Dev Volume Status</CardTitle>
          </Card>
        </MonitoringSection>

        <Card>
          <CardTitle>Mounted Devices</CardTitle>
        </Card>
      </Container>
    </DeDaSSection>
  );
};

export default DeDaS;
